import React from 'react';
import logo from '../imgs/logo';

function Header() {
    return(
      <section>
        <div>
          Free shipping from $50
        </div>
        <div>
          <img src={logo} alt="Fresh"/>
        </div>
      </section>

    );
  }

  export default Header;
